INSERT INTO "public"."product" VALUES ('CONTACTS Men Beige Leather Wallets With RFID', 'CONTACTS', '261', 'Rs.2499', 'images/CONTACTS Men Beige Leather Wallets With RFID.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 205 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><p>This is a classic genuine leather wallet from CONTACTS. This wallet acts as the perfect accessory to complete your look and make you stand out. Featuring an elegant design, hand stitched; dyed and aged this wallet is long-lasting, light weight and a fine quality genuine leather product. It shows your personality and style every time you pull it out. This smooth rich, supple, and luxurious leather wallet has been made out of grain genuine leather. If you are using first time or have least knowledge about pure leather then don''t worry about its colour variation. Pure leather wallets get more beautiful on ageing. These are not PU which will contain shine on its surface.Material care instruction: If leather gets too wet, dry it slowly. Speed drying leather changes its chemical structure and you end up with stiff crinkle cut chaos. So aim for room temperature drying with gentle air rather than direct heater time with a hair-dryer.</p></p>', '5
