hrough the day or when you want and also gives you an alert if the heart rate is not within normal range</li><li>Relax - This feature in Fire-Boltt Eclipse smartwatch lets you choose your mood and then presets a breathing exercise for you to to relax and loosen up for the evening or the day</li><li>Warranty: 1 year</li><li>Warranty provided by Brand/Manufacturer</li></ul></p>', '5
