INSERT INTO "public"."product" VALUES ('Fire-Boltt Eclipse Luxe 1.43" Full Touch AMOLED BT Calling Smartwatch', 'Fire-Boltt', '769', 'Rs.19999', 'images/Fire-Boltt Eclipse Luxe 1.43" Full Touch AMOLED BT Calling Smartwatch.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 227 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features:</b><ul><li>Color: Silver-Toned</li><li>AMOLED High Resolution Smartwatch - Fire-Boltt Eclipse comes with a beautiful Round AMOLED display measuring 1.43" with a 466*466 pixel ultrahigh reoslution</li><li>Bluetooth Calling Smartwatch - This watch is equipped with an advanced chipset that allows you to enhance the experience with the watch. Now you can make and receive calls on the watch. It has an inbuilt dial pad, contact sync and recent call feature</li><li>AI Voice Assistant - This smartwatch has the feature to activate your google/Siri voice assistant on your phone through the watch. Just one tap and get the voice assistant working on functions to ease the experience</li><li>100+ Sports Modes - Fire-Boltt Eclipse comes with an intense workout feeling. The watch comprises of 100+ sports modes and lets you use the watch as a fitness tracker by helping you track steps, calories, km, and much more</li><li>Calculations in Seconds - Very unique and new feature with Fire-Boltt Eclipse is that it comes with a calculator in it, now doing calculations has become faster saving your time and energy to remove your phone to do some in-meeting numbers</li><li>Always On Display (AOD) - With the AMOLED feature, this watch features AOD that allows you to keep the watch in an analog clock mode helping you to see the time anytime anywhere.</li><li>Fire-Boltt Health Suite - Health is an important metric that needs to be covered for your smartwatch to be complete. Fire-Boltt Eclipse makes sure to track your heart rate through the day or when you want and also gives you an alert if the heart rate is not within normal range</li><li>Relax - This feature in Fire-Boltt Eclipse smartwatch lets you choose your mood and then presets a breathing exercise for you to to relax and loosen up for the evening or the day</li><li>Warranty: 1 year</li><li>Warranty provided by Brand/Manufacturer</li></ul></p>', '5
