INSERT INTO "public"."product" VALUES ('Fire-Boltt Crusader 1.43" Amoled Display Bluetooth Calling Smartwatch', 'Fire-Boltt', '772', 'Rs.18999', 'images/Fire-Boltt Crusader 1.43" Amoled Display Bluetooth Calling Smartwatch.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 219 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features:</b><ul><li>Color: Grey</li><li>Masterful AMOLED Display - Immerse yourself in breathtaking visuals on the expansive 1.43" AMOLED display. Every detail comes alive, even in the harshest lighting conditions, ensuring you stay informed and entertained wherever your journey takes you.</li><li>Built to Endure - Crafted with a metal body that''s as tough as your spirit, the Crusader is a statement of durability. Its rugged look and tough design not only withstand the elements but also add an air of adventure to your style.</li><li>Stay Connected Anywhere - Stay in touch with loved ones and fellow adventurers thanks to Bluetooth calling. Wherever your exploration leads, the Crusader keeps you connected with seamless one-time pairing.</li><li>Power that Lasts - Adventure without limits with the 400mAh battery, designed to keep up with your outdoor escapades. The Crusader''s efficient power management ensures that your watch won''t falter, allowing you to stay on track for longer.</li><li>Always Ready for Action - The Always On Display ensures you''re never out of the loop, even when you''re on the move. Essential information is at your fingertips, allowing you to stay aware of your surroundings and make informed decisions.</li><li>Unleash Your Adventurous Spirit - Embrace the wild and take on challenges head-on with the Fire-Boltt Crusader. Whether you''re hiking, camping, or exploring uncharted territories, this timepiece is specifically crafted to match your outdoor lifestyle.</li><li>Conquer the Outdoors with Confidence - The Fire-Boltt Crusader isn''t just a smartwatch; it''s your trusted companion on your daring journeys. With a focus on rugged reliability and modern technology, it''s time to unleash your inner explorer</li><li>Warranty: 1 year</li><li>Warranty provided by Brand/Manufacturer</li></ul></p>', '5
