INSERT INTO "public"."product" VALUES ('CMF by Nothing Watch Pro', 'CMF by Nothing', '775', 'Rs.5999', 'images/CMF by Nothing Watch Pro.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 221 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features:</b><ul><li>Color: Silver</li><li>The industry''s biggest. CMF Watch Pros</li><li>Mighty 1.96 AMOLED display magnifies your information with brighter colours and better visuals than standard OLED.</li><li>With 600+ nits peak brightness, the 410x502 resolution screen brings your most important data to life.</li><li>Get what you need instantly with a 58 fps refresh rate, ensuring ultra smooth touch-responsiveness on-the-go.</li><li>Track your outdoor activities with precision. With support for multiple satellite positioning systems, you can effortlessly obtain accurate trace and distance data for activities such as running, cycling, walking and hiking.</li><li>Beyond fitness tracking, the CMF Watch Pro also allows you to focus on your wellbeing with a whole host of health tracking features, including real-time heart rate and blood oxygen saturation monitoring, as well as the ability to track your sleep and stress levels.</li><li>Get reminders for hydration and movement too. Set personalized goals and watch your progress grow with you.</li><li>The CMF Watch Pro uses AI technology to deliver unparalleled call clarity.</li><li>Use the dialpad to access your contact list so you can make and receive calls on-the-go.</li><li>The inbuilt microphone and speaker provides reduced background noise and increased speech quality.</li><li>Trained on over 100,000 noise models, AI can accurately identify the type of noise in your environment and cancel it out to ensure the clearest calls.</li><li>Warranty: 1 year</li><li>Warranty provided by Brand/Manufacturer</li></ul></p>', '5
