INSERT INTO "public"."product" VALUES ('boAt Black Ultima Prism 1.96" AMOLED Display Smart Watch', 'boAt', '790', 'Rs.8999', 'images/boAt Black Ultima Prism 1.96" AMOLED Display Smart Watch.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 215 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features</b><ul><li>Powered By Crest+ OS</li><li>1.96" AMOLED Display:&nbsp;Unveil the future with the striking 1.96\" AMOLED Display of Ultima Prism with&nbsp;410X502 resolution . Get instant access to vital information through the day with its Always-On Display and wake gesture features. Interact with the brillant, dynamic screen of Ultima Prism that illuminates with 650 Nits brightness.</li><li>DIY Watch Face Studio: Ultima Prism helps you customize your watch to be a reflection of your personal style. Choose from a range of unique watch faces and make a statement with Ultima Prism. Select backgrounds, colors, fonts and add personalized elements to make your smartwatch truly your own!</li><li>boAt Coins: With Ultime Prism, you get rewarded for all the activities you do. Reaching your fitness journey is no longer a boring goal. Get instant rewards with boAt coins on boAt Crest App. Be on top of your sleep schedule, maintain your energy and receive badges on the Crest App. Encash these coins on the boAt website/app or get vouchers from partner companies.</li><li>Ultra seamless Bluetooth Calling:&nbsp;Ultima Prism''s BT calling, supported by a single chip, ensures better connectivity right from your wrist. Save up to 20 contacts on your smartwatch and make use of the interactive dialpad, premium speaker and microphone to stay connected!</li><li>Crest App Health Ecosystem: Crest App Health Ecosystem is designed to enhance and facilitate your overall well-being. With a wide range of health and wellness features, your fitness journey is not yours alone. Create fitness plans that suit your fitness goals, receive badges for each goal that you accomplish and so much more!</li><li>700+ Active Modes: Ultima Prism brings to you a pathway of 700 ways to stay fit! Whether you prefer running, weight training, yoga, or dancing, Ultima Prism offers it all with its 700+ active modes.</li><li>Health and Wellness: Energy scores, Sleep scores, Heart Rate, SpO2, Sleep.&nbsp;Take advantage of the health and wellness feature and get real-time information about your cardiovascular health. Maintain your energy and sleep scores with Ultima Prism and lead a healthier lifestyle with these features.</li><li>Power Saving Mode: Time to be limitless. With up to 30 days of standby time, you can confidently wear your smartwatch without the hassle of charging it frequently. Ultima Prism is designed to facilitate heavy usage for 7 days without running out of battery. Even with BT calling, Ultima Prism lasts 2 days.</li><li>Live Sports Score - Cricket and Football: Stay up to date with the latest scores of cricket and football matches.</li><li>Notifications, DND Mode and Quick Replies</li><li>Daily Activity Tracker and Sedentary Alert: Ultima Prism serves as your personal activity tracker, monitoring your daily movements. Be it distance covered, calories burned, steps taken- your smartwatch is designed to keep up.</li><li>Custom reminders: Medicine,&nbsp;Handwash and Water</li><li>Voice Assistant: Google,&nbsp;Siri</li><li>Utility Unit: Music Control, Camera Control, Alarm, Stopwatch, Timer, Weather, Find my Phone and Watch</li><li>Warranty: 1 year</li><li>Warranty provided by brand/manufacturer&nbsp;</li></ul></p>', '5
