INSERT INTO "public"."product" VALUES ('boAt Lunar Mirage 1.52" HD Display Smartwatch', 'boAt', '794', 'Rs.7999', 'images/boAt Lunar Mirage 1.52" HD Display Smartwatch.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 219 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features:</b><ul><li>Color: Black</li><li>1.52" HD Display: Largest Display in Circular Dial</li><li>360*360 Resolution - Ensures Better colour depth, clear and bright visuals</li><li>Always on Display: 550 Nits</li><li>The Lunar mirage smartwatch boasts an impressive 1.52" HD display, setting a new standard for circular dial screens.</li><li>With its remarkable 360x360 resolution, it delivers vibrant colors and crystal-clear visuals.</li><li>The always-on display feature ensures you''re never out of touch, even in bright sunlight, thanks to its 550 Nits brightness.</li><li><b>Functional Crown</b>: Lunar Mirage speaks of convenience. Its functional crown doesn''t only add a touch of elegance to its design but also provides a convenient way to navigate through its intuitive surface. Whether you''re scrolling through notifications or adjusting settings, the Lunar Mirage''s crown makes interaction seamless and stylish. Elevate your smartwatch experience with Lunar Mira</li><li><b>Ultra Seamless Single Chip Bluetooth Calling</b>: Versatile smartwatch offers ultra seamless bluetooth technology,</li><li><b>Dialpad</b>: 10+ Contacts</li><li><b>Seamless Connectivity</b>: Lunar Mirage sets the standard for smartwatch connectivity with its ultra-seamless single-chip Bluetooth calling. Offering a user-friendly dialpad, Lunar Mirage ensures effortless communication at your fingertips. Experience unparalleled convenience and flawless connectivity with Lunar Mirage, making every call a breeze.</li><li><b>Health &amp; Wellness Monitoring: SpO2 Monitoring</b> - Understand your oxygen saturation levels in the blood to have valuable insights about your body.</li><li><b>Heart Rate Monitoring</b> - Heart rate tracking through the sensors will display heart rate in real-time, with the option to view historical data over time.</li><li><b>Menstrual Cycle Tracking</b> - Preparing and tracking your cycle.</li><li><b>Sedentary Alerts</b> - Avoid the negative health effects of prolonged sitting with reminders/ alerts to get up and move around.</li><li><b>Sleep Monitoring</b> - Track your sleep patterns and gain insights into your sleep quality, duration, and consistency.</li><li><b>Step &amp; Calorie Tracking</b> - Stay motivated, track your progress, and achieve your fitness goals more effectively.</li><li><b>100+ Sports Modes</b>: Lunar Mirage offers 100 different ways to stay fit. Get the option to choose between different modes and fitness activities, depending on your fitness levels and goals.</li><li>100+ Cloud Watch Faces: Choose different watch faces to match your Mood everyday!</li><li><b>Up to 10 Days Battery</b> -Upto 7 Days Battery and 2 Days with BT calling</li><li>IP67 Dust, Sweat, Splash Resistance: Lunar Vista is highly resistant to dust, sweat and splashes. Built to resist, your partner for everyday adventure.</li><li>Notifications and Find My Phone: Stay updated at your convenience. Receive all your notifications like texts, social media, emails, call alerts etc. on your wrist.</li><li>Utility Unit: Alarms, Countdown Timer, Stopwatch, Camera controls, Music Controls, Weather</li><li>Voice Assistant - Google and Siri</li><li>Warranty:1 year</li><li>Warranty provided by Brand/Manufacturer</li></ul></p>', '5
