INSERT INTO "public"."product" VALUES ('boAt Raging Red 115 M TWS Airdopes', 'boAt', '820', 'Rs.2990', 'images/boAt Raging Red 115 M TWS Airdopes.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 217 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>Features</b><ul><li>Are you ready to get into the groove that sways, with Airdopes 115 TWS earbuds.&nbsp;Pro gamer? We got you. A do-it-all hustler? Even better! Airdopes 115 is the perfect choice for both worlds. Its 13mm drivers will make you experience a thumping bass and drown you in the unbeatable boAt Signature Sound.&nbsp;</li><li>13mm Drivers - boAt Immersive Audio -&nbsp;With 13mm drivers, boAt Immersive Audio shines through even in loud and noisy surroundings.&nbsp;</li><li>ENx Tech -<b>&nbsp;</b>The ENx technology suppresses ambient noise and makes conversations as clear as in person, helps you to be heard crystal clear across voice calls.&nbsp;Call disturbance will never be an issue.</li><li>The addition of BEAST Mode makes the low latency experience a reality for your casual gaming and entertainment sessions.&nbsp;Get the gamer to win matches with minimum lag powered by BEAST Mode.&nbsp;The BEAST mode powered Airdopes 115&nbsp;ensures low latency.</li><li>It comes equipped with Bluetooth v5.2 wireless technology so that you can enjoy all of your sessions in a seamless manner.</li><li>IWP[?] Technology -&nbsp;The Insta Wake N'' Pair technology lets you connect and disconnect your Airdopes in a jiffy. Simply open the lid to wake them up and close it to disconnect. The IWP tech enabled TWS earbuds power on as soon as the case lid gets opened.</li><li>The ASAP Charge tech helps the earbuds to gather up to 180 min of playtime in only 10 minutes of charging.</li><li>Up to 24 HRS Total Playback -&nbsp;Airdopes 115 comes with a total backup of 24 hours that lasts you through the day. The 3X Case Fuel matches the pace of your life.&nbsp;&nbsp;Airdopes 115 provides a total playback time of up to 24HRS including up to 6HRS of playtime per earbud.</li><li>IPX4 Sweat Resistance -&nbsp;IPX4 Sweat Resistance prevents your Airdopes from any damage that sweat or everyday spills or splashes could lead to. With an IPX4 marked water resistance and lightweight build, the earbuds offer flexibility whether you are at the gym or traversing those far terrains.</li><li>You can command playback, hands-free and activate voice assistant with ease via the instant response touch controls.</li><li>Stay indulged in your playlists and enjoy a truly immersive auditory experience on Airdopes 115.</li></ul><b>Specifications</b><ul><li>Headphone TypeTWS Earbuds</li><li>Driver Size - 13mm</li><li>Bluetooth Version - v5.2</li><li>Bluetooth Range - 10m</li><li>Battery Capacity - 300mAh Case, 35mAh*2 Earbuds</li><li>Playing Time - Up to 24 Hours with case (at 60% volume)</li><li>Charging Time - 30 mins earbuds and 1.5 hours case</li><li>Charging Interface - USB Type C</li><li>Water Resistance - IPX4</li><li>Warranty: 1 year</li><li>Warranty provided by brand/manufacturer</li></ul></p>', '5
