INSERT INTO "public"."product" VALUES ('Minimalist SPF 50 PA++++ Multi Vitamin Sunscreen', 'Minimalist', '1070', 'Rs.399', 'images/Minimalist SPF 50 PA++++ Multi Vitamin Sunscreen.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 227 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content">Minimalist SPF 50 PA++++ Multi Vitamin Sunscreen<br><br>A light weight, moisturiser-meets-sunscreen. This broad spectrum SPF 50 with PA++++ rating, has a very light texture that spreads easily &amp; disappears leaving behind a natural, moisturised, non-shiny look.<br><br>Loaded with Vitamins A, B, E &amp; F that help repair skin and minimise damage caused by UV exposure.Why is it awesome?This sunscreen is formulated with 4 very effective UV-filters, namely, Uvinul T 150, Avobenzone, Octocrylene and Titanium Dioxide to provide protection from UVA &amp; UVBBoosted with Vitamin A, B3, B5, E and F that not only repairs skin after sun exposure, but also soothes, nourishes and hydrates skinThoroughly tested by an independent lab and confirmed SPF of 50 was obtainedIt is a photostable sunscreen offering you more efficient &amp; prolonged protection from UV.<br><br>Also, it does not leave any white cast on application. It spreads easily like a lightweight moisturiser and does not leave behind unwated residue or heavy feelingThe primary filters are sourced from BASF, Germany and Royal DSM, Netherlands<br><br><b>Full list of ingredients:</b><br><br>Aqua, Octocrylene, Diisopropyl Adipate, Propylene Glycol Dicaprylate/Dicaprate, C12-15 Alkyl Benzoate, Diisopropyl Sebacate, Butyl Methoxydibenzoylmethane, Isododecane, Niacinamide, Arachidyl Alcohol, Behenyl Alcohol, Arachidyl Glucoside, Caprylic/Capric Triglyceride, Titanium Dioxide, Ethylhexyl Triazone, PEG-100 Stearate, Glyceryl Stearate, Butylene Glycol, Linoleic Acid, Linolenic Acid, Panthenol, Sodium Hyaluronate, Allantoin, Tocopherol Acetate, Retinol, Polysorbate 20, Hydroxyethyl Acrylate/Sodium Acryloyldimethyl Taurate Copolymer, Xanthan Gum, Polyacrylate Crosspolymer-6, Silica, Acacia Gum, Phenoxyethanol, Ethylhexylglycerin, Trisodium Ethylenediamine Disuccinate</p>', '5
