INSERT INTO "public"."product" VALUES ('Nivea Smooth Milk Body Lotion For Dry Skin 200 ml', 'Nivea', '1145', 'Rs.300', 'images/Nivea Smooth Milk Body Lotion For Dry Skin 200 ml.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 237 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>SUITABLE FOR WHICH SKIN TYPE?</b><ul><li>Dry skin</li></ul><b>WHAT IT IS?</b><ul><li>Experience a unique care experience - NIVEA Smooth Milk Body Lotion with Hydra IQ and Shea Butter provides long-lasting moisture. The formula absorbs quickly and pampers your skin with a velvety feel.</li><li>The creamy and smooth 24-hour intensive moisturizer is especially developed to meet the needs of dry skin. The light texture is easy to spread, and is non-greasy.</li></ul><b>WHAT IT DOES?</b><ul><li>The NIVEA Smooth Milk Body Lotion works deep within the skin repairing dryness layer by layer to give you long-lasting softness and protection.</li><li>Enriched with deep moisturizing ingredients, the body lotion provides long lasting smoothness too.</li></ul><b>INGREDIENTS </b><ul><li>Aqua, Glycerin, Cetearyl Alcohol, Isohexadecane, Isopropyl Palmitate, Paraffinum Liquidum, Glyceryl Stearate SE, Butyrospermum Parkii Butter, Dimethicone, Glyceryl Stearate, Theobroma Cacao Seed Butter, Cocos Nucifera Oil, Tocopheryl Acetate, Glyceryl Glucoside, Carbomer, Sodium Cetearyl Sulfate, Trisodium EDTA, Ethylparaben, Methylparaben, Phenoxyethanol, Sodium Hydroxide, Parfum</li></ul><b>SPECIAL FEATURES</b><ul><li>Enriched with Shea butter, Gingko extract and Vitamin E, this body lotion has a light texture, is easy to spread on the skin, delivers intense nourishment and makes the skin irresistibly smooth.</li><li>Enjoy smooth skin all day long, along with its delicate scent.</li><li>The formula with Hydra IQ, reactivates your skin''s own moisture network to give 24 hour moisturisation with just one use.</li><li>Long-lasting softness and protection</li></ul><b>ABOUT THE BRAND</b><br>Over 100 years ago, we invented modern skin care with NIVEA Creme. Today, millions of people all over the world, all with different types of skin, rely on the NIVEA brand. That is why our researchers work extensively with different skin types and the different care requirements brought about by culture, gender and age. Thanks to this approach, we have developed numerous innovative skin care products over the past few decades from deodorants to sunscreen products. We work with over 50 institutions around the world to ensure that our products are suitable for your skin. At our headquarters in Hamburg we have even set up our own laboratory for Asia and Latin America, where we conduct research specifically aimed at skin types and climate conditions found in these regions. We do this so that one day everybody in the world can place their trust in NIVEA products.</p>', '5
