INSERT INTO "public"."product" VALUES ('Vaseline Intensive Care Cocoa Glow Body Lotion 400 ml', 'Vaseline', '1139', 'Rs.475', 'images/Vaseline Intensive Care Cocoa Glow Body Lotion 400 ml.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 246 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content">Intensive Care Cocoa Glow Body Lotion<br><br>With daily exposure to environmental triggers, skin''s natural moisture barrier can break down, allowing water to escape the skin. Vaseline Intensive Care Cocoa Glow Lotion contains Micro-droplets of Vaseline Jelly that locks in moisture within skin to allow the skin''s natural barrier to recover. Get a Healthy, glowing skin with our Vaseline Intensive Care Cocoa Glow Body Lotion. Your skin won''t feel oily after using this body moisturizer - the fast-absorbing formula moisturizes and leaves the skin soft and glowing, without any greasy feel. Our rich formula combining with 100% pure cocoa and shea butters, gives your skin a healthy glow. Deep Moisturizing Daily Body Lotion: Vaseline Cocoa Glow goes beyond basic moisturization. Our Intensive Care range deeply heals and restores dry dull skin for glowing radiance. Vaseline Intensive Care Cocoa Glow Lotion provides 48hr moisturisation. Our rich moisturizing lotion restores the essential moisture your skin needs with a blend of nourishing ingredients to give a natural, healthy, glowing skin. Intensive Care Cocoa Glow Body Lotion infused with cocoa butter gives a pleasant, subtle fragrance. Healing by moisturization of normal dry skin. Action in the epidermal region and within cosmetic domain within epidermis. Based on Moisturisation clinical study,2021. The Vaseline smart pump unlocks with just a 90@ turn. With quick-lock technology, the pump locks in the raised position after a quarter turn, for easier use and no mess.</p>', '5
