INSERT INTO "public"."product" VALUES ('Fabindia Lavender Rosemary Hand & Body Lotion - 300 ml', 'Fabindia', '1151', 'Rs.350', 'images/Fabindia Lavender Rosemary Hand & Body Lotion - 300 ml.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 213 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content">Lavender Rosemary Hand &amp; Body Lotion<br><br><b>Benefits&nbsp;</b><ul><li>Pro Skin Care - Moisturises, softens rough skin, cuticles and nails</li><li>Protects against external elements</li><li>Fabessentials Lavender Rosemary Hand &amp; Body Lotion is a rich blend of nourishing nut oils, skin-softening ingredients, Lavender and Rosemary extracts to provide exceptional hydration.</li></ul><b>Features&nbsp;</b><ul><li>Free from added Phosphate, Phthalate, Paraben, Formaldehyde &amp; GMO</li><li>With Natural Bioactives</li><li>Fragrance as per IFRA guideline</li></ul><b>Ingredients&nbsp;</b><ul><li>Free from added Phosphate, Phthalate, Paraben, Formaldehyde &amp; GMO</li><li>With Natural Bioactives</li><li>Fragrance as per IFRA guideline</li></ul><b>Full Ingredients List</b><br>Purified Water, Cetearyl alcohol, Glycerin, Paraffinum Liquidum, Glycerol Mono Stearate, PEG-100 Stearate (and) Glyceryl Stearate, Perfume, DMDM Hydantoin, Caprylic/Capric Triglyceride, Propylene Glycol, Carbomer, Achillea Millefolium (Rosemary) Extract, Butyrospermum Parkii (Shea) Butter , Disodium EDTA, Lavandula Angustifolia (Lavender) Extract, Theobroma Cacao (Cocoa) Seed Butter, Butyl Hydroxytoulene, Tocopheryl Acetate (Vitamin E), Triethanolamine , Citric Acid, CI 45100, CI 74160.<br><br><b>About The Brand&nbsp;</b><br>Founded in 1960 by John Bissell to market the diverse craft traditions of India, Fabindia started out as a company exporting home furnishings. Soon it became an umbrella multi-category store brand with a unique ethnic, artisanal positioning across the categories of fashion, lifestyle, home decor and personal care. Fabindia is a legacy brand focusing on handcrafted, indigenous products. The company has established a brand built on artisanal heritage and tradition, inherited across various product categories.<br><br>Fabessentials by Fabindia was formed out of a need for personal care products that are free of endocrine disruptors, toxins &amp; harmful chemicals with an endeavor to deliver scientifically backed products that are made in India. Currently the brand has developed 90 products having the best of both Science &amp; Tradition. The brand is rooted in kindness with focus on gentle, toxin-free daily essentials with natural bioactives that deliver visible results inside out. Our products are ethically sourced with highest quality standards &amp; multiple certifications like Free from added (phosphate, phthalate, GMO, paraben, formaldehyde), dermatologically tested, IFRA certified fragrances, use of FSC certified packaging paper and powered with natural bioactives, certified organic ingredients, 100% edible grade flavour etc. These claims are applicable to specific products and ranges which can be checked on individual pack. There are also vibrant and exotic ranges of herbs, flowers, fruit extracts, oils, butters etc. which combine together to create unique product formulations. Here both Indian &amp; International natural ingredients come together to curate contemporary product ranges of Fabessentials like Neem, Tulsi &amp; Moringa | Saffron, Turmeric &amp; Marigold | Silk, Argan &amp; Gotu Kola | Banana Rice Water | Apple Cider Vinegar etc.</p>', '5
