INSERT INTO "public"."product" VALUES ('Havells Women Wide Plate Hair Straightener HS4121', 'Havells', '1669', 'Rs.2195', 'images/Havells Women Wide Plate Hair Straightener HS4121.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 205 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content"><b>What it is:</b><br>Getting that soft, smooth, silky, straight hair is no longer an impossible dream! Havells, a leading brand of electric products, brings the perfect tool to get the poker straight hair - Havells HS4121 Red Wide plate straightener! One of the most popular products from its well curated female grooming range, this straightener will instantly transform frizzy unruly mane into gorgeous shining locks. Taking the effort and time ladies spend in achieving that straight hair into consideration, Havells has come up with an exclusive range of hair straighteners. They will not only ease the tedious process of hair straightening for women but also will not make the hair permanently straight, giving them an option to style it however they want.<br><br><b>Features:</b><ul><li>Digital Display : It comes with a digital temperature display to indicate the exact heat level.</li><li>Ceramic Coated Plates : Ceramic-coated plates provide superior hair styling as they are more effective in removing frizz, giving you a smooth and soft hair.</li><li>Adjustable Temperature Settings : Allows you to choose the perfect heat (150 degC to 230 degC) for your hair type</li><li>Guarantee : 2 year product guarantee</li></ul></p>', '5
