INSERT INTO "public"."product" VALUES ('dyson Dyson Corrale Hair Straightener - Bright Copper', 'dyson', '1704', 'Rs.43900', 'images/dyson Dyson Corrale Hair Straightener - Bright Copper.jpg', '<h4 class="pdp-product-description-title"><!-- react-text: 223 -->Product Details <!-- /react-text --><span class="myntraweb-sprite pdp-productDetailsIcon sprites-productDetailsIcon"></span></h4><p class="pdp-product-description-content">The Dyson Corrale hair straightener is the only straightener with flexing copper plates that flex around your hair to gather it. This extra control allows you to create the same style but with less heat - and half the damage. It also means enhanced styling, for reduced frizz and fewer flyaways.&nbsp;<ul><li>It can be used corded, or cord-free to provide extra versatility and freedom while styling. Using a 4-cell lithium-ion battery, it delivers up to 30 minutes of cord-free styling4 with the thermal performance of a corded straightener. If you need to style for longer, attach the magnetic 360deg cable and style in hybrid charge mode. The length of the cable is 3.31 metres long.</li><li>It is engineered for all hair types, with three precise heat settings - 165degC, 185degC and 210degC. Intelligent heat control, regulates the temperature of the plates 100 times a second, it will not exceed your chosen temperature. When not in use, simply place it in the charging dock to recharge: it fully recharges in just 70 minutes. The OLED display, allows you to see the battery level and charging status, as well as the temperature settings.</li><li>The auto shut off feature means the machine will switch off after 10 minutes of inactivity for peace of mind and a safety lock for immediate storage after use. It also has universal voltage, a flight-ready tag feature and a heat resistant pouch for convenience during travelling.</li></ul></p>', '5
