-- ----------------------------
-- Function structure for after_payment
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."after_payment"();
CREATE OR REPLACE FUNCTION "public"."after_payment"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
    INSERT INTO order_table
    VALUES (OLD.id,OLD.product_id,OLD.quantity,OLD.license,'confirmed',NULL);
    RETURN OLD;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for assign_cart
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."assign_cart"();
CREATE OR REPLACE FUNCTION "public"."assign_cart"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
DECLARE
    counter INTEGER; 
BEGIN
    SELECT COUNT(*) INTO counter from cart_customer;
		counter := counter+1;
		INSERT INTO cart_customer VALUES(counter,NEW.phone_number);
    RETURN NEW; 
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Procedure structure for balance_deduct
-- ----------------------------
DROP PROCEDURE IF EXISTS "public"."balance_deduct"("amount" numeric, "id1" int4);
CREATE OR REPLACE PROCEDURE "public"."balance_deduct"("amount" numeric, "id1" int4)
 AS $BODY$
DECLARE
    current_balance NUMERIC;
BEGIN
    SELECT balance INTO current_balance FROM customer WHERE phone_number =(SELECT customer_phone FROM cart_customer WHERE cart_customer.id = id1);
    
    -- Check if the amount is greater than the current balance
    IF amount > current_balance THEN
        -- Raise an exception if the amount is greater than the balance
        RAISE EXCEPTION 'Insufficient balance';
    ELSE
        -- Deduct the amount from the balance
        UPDATE customer SET balance = balance - amount WHERE phone_number =(SELECT customer_phone FROM cart_customer WHERE cart_customer.id = id1);
    END IF;
END;
$BODY$
  LANGUAGE plpgsql;

-- ----------------------------
-- Function structure for before_payment
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."before_payment"();
CREATE OR REPLACE FUNCTION "public"."before_payment"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
DECLARE value1 int4;
  value2 int4;
  old_id int4;
BEGIN
  
  old_id := OLD.id;  -- Get ID from the deleted row

  -- Calculate total discounted price using OLD record
  SELECT sum(CAST(discount.discounted_price AS NUMERIC) * CAST(cart_product.quantity AS NUMERIC))
  INTO value1
  FROM cart_product
  JOIN discount ON cart_product.product_id = discount.product_id
  WHERE cart_product.id = old_id;

  -- Get customer balance
  SELECT balance INTO value2 FROM customer
  WHERE phone_number = (SELECT customer_phone FROM cart_customer WHERE id = old_id);

  IF (value2 - value1) < 0 THEN
    RAISE EXCEPTION 'Not enough balance';
  ELSE
    RAISE NOTICE 'Balance sufficient for product with ID: %', old_id;
    UPDATE customer SET balance = value2 - value1
    WHERE phone_number = (SELECT customer_phone FROM cart_customer WHERE id = old_id);
  END IF;

  RETURN OLD;  -- Optional: Return the OLD record (not used for deletion)
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for check_duplicate_signup_function
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."check_duplicate_signup_function"();
CREATE OR REPLACE FUNCTION "public"."check_duplicate_signup_function"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
BEGIN
    IF EXISTS (SELECT 1 FROM customer_copy WHERE name = NEW.name) THEN
        RAISE EXCEPTION 'Customer with this phone number already exists';
    END IF;
    RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

-- ----------------------------
-- Function structure for check_product_availability
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."check_product_availability"();
CREATE OR REPLACE FUNCTION "public"."check_product_availability"()
  RETURNS "pg_catalog"."trigger" AS $BODY$
DECLARE
    st boolean;
BEGIN
		SELECT availability into st FROM discount WHERE product_id= NEW.product_id AND shop_license=NEW.license;
		RAISE NOTICE 'Value: %',st;
    IF  st='false' THEN
        RAISE EXCEPTION 'Out Of Stock';
    END IF;
		RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

