-- ----------------------------
-- Function structure for cust_price_sum
-- ----------------------------
DROP FUNCTION IF EXISTS "public"."cust_price_sum"("customer_phone1" varchar);
CREATE OR REPLACE FUNCTION "public"."cust_price_sum"("customer_phone1" varchar)
  RETURNS "pg_catalog"."numeric" AS $BODY$
DECLARE
    price_sum NUMERIC;
BEGIN
    SELECT SUM(CAST(discount.discounted_price AS NUMERIC)* CAST(cart_product.quantity AS NUMERIC))
    INTO price_sum
    FROM cart_product
    JOIN discount ON cart_product.product_id = discount.product_id
    JOIN cart_customer ON cart_product.id = cart_customer.id
    WHERE cart_customer.customer_phone = customer_phone1;
    
    RETURN price_sum;
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

