-- ----------------------------
-- Procedure structure for procedure_name
-- ----------------------------
DROP PROCEDURE IF EXISTS "public"."procedure_name"("s_license" varchar, "p_id" varchar, "c_id" int4);
CREATE OR REPLACE PROCEDURE "public"."procedure_name"("s_license" varchar, "p_id" varchar, "c_id" int4)
 AS $BODY$
DECLARE
    cart_id INTEGER;
BEGIN
    UPDATE cart_product
		SET status=TRUE
		WHERE id=c_id AND product_id=p_id AND license=s_license;
END;
$BODY$
  LANGUAGE plpgsql;

